ctFeeQuantity //contrunct fee quantity 构建手续费 valueInvest_.actualinvestValue //value of invest 实际投资价值 valueInvest_.actualinvestQuantity //the quantity of invest 实际投资数量 proofno_ uint256 normalProofno_ 证明编号","breadcrumbs":"MarketManager » investNormalGood","id":"243","title":"investNormalGood"},"244":{"body":"disinvest normal good~撤资普通商品 function disinvestNormalGood(uint256 _togood, uint256 _valuegood, uint128 _goodQuanitity, address _gater) external override noReentrant returns ( L_Good.S_GoodDisinvestReturn memory disinvestNormalResult1_, L_Good.S_GoodDisinvestReturn memory disinvestValueResult2_, uint256 normalproofno_ ); Parameters Name Type Description _togood uint256 normal good No~普通商品编号 _valuegood uint256 value Good No~价值商品编号 _goodQuanitity uint128 disinvest quantity~取消普通商品投资数量 _gater address gater address~门户 Returns Name Type Description disinvestNormalResult1_ L_Good.S_GoodDisinvestReturn disinvestResult1_ 普通商品结果 disinvestResult1_.profit; // profit of stake 投资收入 disinvestResult1_.actual_fee; // actual fee 实际手续费 disinvestResult1_.actualDisinvestValue; // disinvest value 撤资价值 disinvestResult1_.actualDisinvestQuantity; //disinvest quantity 撤资数量 disinvestValueResult2_ L_Good.S_GoodDisinvestReturn disinvestResult2_ 价值商品结果 disinvestResult2_.profit; // profit of stake 投资收入 disinvestResult2_.actual_fee; // actual fee 实际手续费 disinvestResult2_.actualDisinvestValue; // disinvest value 撤资价值 disinvestResult2_.actualDisinvestQuantity; //disinvest quantity 撤资数量 normalproofno_ uint256 normalProofno_ 证明编号","breadcrumbs":"MarketManager » disinvestNormalGood","id":"244","title":"disinvestNormalGood"},"245":{"body":"disinvest value good~撤资价值商品 function disinvestValueProof(uint256 _valueproofid, uint128 _goodQuanitity, address _gater) external override noReentrant returns (L_Good.S_GoodDisinvestReturn memory disinvestResult_); Parameters Name Type Description _valueproofid uint256 the invest proof No of value good ~价值投资证明的编号编号 _goodQuanitity uint128 the quantity of value good to disinvest~取消价值商品的数量 _gater address gater~门户 Returns Name Type Description disinvestResult_ L_Good.S_GoodDisinvestReturn disinvestResult_ disinvestResult_.profit; // profit of stake 投资收入 disinvestResult_.actual_fee; // actual fee 实际手续费 disinvestResult_.actualDisinvestValue; // disinvest value 撤资价值 disinvestResult_.actualDisinvestQuantity; //disinvest quantity 撤资数量","breadcrumbs":"MarketManager » disinvestValueProof","id":"245","title":"disinvestValueProof"},"246":{"body":"disinvest normal good~撤资普通商品 function disinvestNormalProof(uint256 _normalProof, uint128 _goodQuanitity, address _gater) external override noReentrant returns ( L_Good.S_GoodDisinvestReturn memory disinvestNormalResult1_, L_Good.S_GoodDisinvestReturn memory disinvestValueResult2_ ); Parameters Name Type Description _normalProof uint256 the invest proof No of normal good ~普通投资证明的编号编号 _goodQuanitity uint128 disinvest quantity~取消普通商品投资数量 _gater address gater address~门户 Returns Name Type Description disinvestNormalResult1_ L_Good.S_GoodDisinvestReturn disinvestResult1_ 普通商品结果 disinvestResult1_.profit; // profit of stake 投资收入 disinvestResult1_.actual_fee; // actual fee 实际手续费 disinvestResult1_.actualDisinvestValue; // disinvest value 撤资价值 disinvestResult1_.actualDisinvestQuantity; //disinvest quantity 撤资数量 disinvestValueResult2_ L_Good.S_GoodDisinvestReturn disinvestResult2_ 价值商品结果 disinvestResult2_.profit; // profit of stake 投资收入 disinvestResult2_.actual_fee; // actual fee 实际手续费 disinvestResult2_.actualDisinvestValue; // disinvest value 撤资价值 disinvestResult2_.actualDisinvestQuantity; //disinvest quantity 撤资数量","breadcrumbs":"MarketManager » disinvestNormalProof","id":"246","title":"disinvestNormalProof"},"247":{"body":"collect the profit of normal proof~提取普通投资证明的收益 function collectValueProofFee(uint256 _valueProofid) external override returns (uint128 profit_); Parameters Name Type Description _valueProofid uint256 the proof No of invest value good~价值投资证明编号 Returns Name Type Description profit_ uint128 profit of invest value good~价值商品的投资收益","breadcrumbs":"MarketManager » collectValueProofFee","id":"247","title":"collectValueProofFee"},"248":{"body":"collect the profit of normal proof~提取普通投资证明的收益 function collectNormalProofFee(uint256 _normalProofid) external override returns (T_BalanceUINT256 profit_); Parameters Name Type Description _normalProofid uint256 the proof No of invest normal good~普通投资证明编号 Returns Name Type Description profit_ T_BalanceUINT256 amount0 普通商品的投资收益 amount1价值商品的投资收益","breadcrumbs":"MarketManager » collectNormalProofFee","id":"248","title":"collectNormalProofFee"},"249":{"body":"Enables calling multiple methods in a single call to the contract","breadcrumbs":"Multicall » Multicall","id":"249","title":"Multicall"},"25":{"body":"Alt text 平台中涉及平台技术,门户运营,推荐人,用户以及流动性提供者.平台会合理分配利润. 其中流动性提供者的手续费分配参见 7.4与7.5手续费流程 如果用户填写了推荐者. 按用户的相关角色进行实时分配. 如果用户未填写推荐者. 手续费分配中用户所占比例划归于商家角色. 手续费分配中推荐者所占比例划归于门户角色.","breadcrumbs":"Home » 7.3 手续费分配","id":"25","title":"7.3 手续费分配"},"250":{"body":"","breadcrumbs":"Multicall » Functions","id":"250","title":"Functions"},"251":{"body":"function multicall(bytes[] calldata data) public payable returns (bytes[] memory results);","breadcrumbs":"Multicall » multicall","id":"251","title":"multicall"},"252":{"body":"Inherits: I_Proof , ERC165","breadcrumbs":"ProofManage » ProofManage","id":"252","title":"ProofManage"},"253":{"body":"","breadcrumbs":"ProofManage » State Variables","id":"253","title":"State Variables"},"254":{"body":"string private constant _name = \"TTSWAP NFT\";","breadcrumbs":"ProofManage » _name","id":"254","title":"_name"},"255":{"body":"string private constant _symbol = \"TTN\";","breadcrumbs":"ProofManage » _symbol","id":"255","title":"_symbol"},"256":{"body":"uint256 public override totalSupply;","breadcrumbs":"ProofManage » totalSupply","id":"256","title":"totalSupply"},"257":{"body":"mapping(uint256 => L_Proof.S_ProofState) internal proofs;","breadcrumbs":"ProofManage » proofs","id":"257","title":"proofs"},"258":{"body":"mapping(address => L_ArrayStorage.S_ArrayStorage) internal ownerproofs;","breadcrumbs":"ProofManage » ownerproofs","id":"258","title":"ownerproofs"},"259":{"body":"mapping(bytes32 => uint256) public proofseq;","breadcrumbs":"ProofManage » proofseq","id":"259","title":"proofseq"},"26":{"body":"Alt text 图1 单位手续费指单位投资应该得到多少手续费,单位手续费=手续费总额/总投资数量; 随着交易的进行,手续费不断产生,手续费总额增加,单位手续费就增加. 构建手续费提用户开始投资时,为记录用户不应该享受的手续费总额. 构建手续费=投资数量X投资时单位手续费 图2 当平台中不停有手续费产生时,单位手续费会不停增加. 用户投资产生的收益=单位手续费x投资数量-构建手续费. 图3 当用户在同一下商品上,进行多笔投资,可以合成同一条投资记录. 合并后的构建手续费=合并前的构建手续费汇总 手户投资产生的收益=单位手续费x投资数量-汇总后的构建手续费 图4 该图展示合并后的投资情况 图5 当多个用户进行投资时,就可以汇总成这个商品总投资数量,总投资市场价值,总构建手续费. 该商品当前总共实际投资利润=当前总费用-汇总构建手续费.","breadcrumbs":"Home » 7.4 手续费计算流程(投资)","id":"26","title":"7.4 手续费计算流程(投资)"},"260":{"body":"mapping(address owner => mapping(address operator => bool)) private _operatorApprovals;","breadcrumbs":"ProofManage » _operatorApprovals","id":"260","title":"_operatorApprovals"},"261":{"body":"","breadcrumbs":"ProofManage » Functions","id":"261","title":"Functions"},"262":{"body":"modifier onlyOwner(uint256 proofid);","breadcrumbs":"ProofManage » onlyOwner","id":"262","title":"onlyOwner"},"263":{"body":"modifier onlyApproval(uint256 proofid);","breadcrumbs":"ProofManage » onlyApproval","id":"263","title":"onlyApproval"},"264":{"body":"constructor();","breadcrumbs":"ProofManage » constructor","id":"264","title":"constructor"},"265":{"body":"function supportsInterface(bytes4 interfaceId) public view override(ERC165, IERC165) returns (bool);","breadcrumbs":"ProofManage » supportsInterface","id":"265","title":"supportsInterface"},"266":{"body":"See IERC721Metadata-tokenURI . function tokenURI(uint256 proofId) external view onlyOwner(proofId) returns (string memory);","breadcrumbs":"ProofManage » tokenURI","id":"266","title":"tokenURI"},"267":{"body":"Base URI for computing tokenURI . If set, the resulting URI for each token will be the concatenation of the baseURI and the proofId. Empty by default, can be overridden